import React from 'react';
import { Navbar, NavDropdown, Nav } from 'react-bootstrap';
import './navbar.css';
import dna from '../../assets/dna.svg';

type Props = {
  isLogged: boolean;
};

const Navigationbar = ({ isLogged }: Props) =>
  isLogged ? (
    <Navbar collapseOnSelect expand="lg" bg="white" variant="light">
      <Navbar.Brand href="#home">
        <img src={dna} alt="genealogy-logo" className="dna-logo-navbar" />
        <span className="ml-2 main-color bold">Genealogy</span>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Link eventKey={2} href="#memes" className="bold">
            Life tree
          </Nav.Link>
          <NavDropdown title="Actions" id="collasible-nav-dropdown" className="bold">
            <NavDropdown.Item href="#action/3.1">New family</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Logout</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  ) : null;

export default Navigationbar;
